app:
  env: dev
  prometheus_dir: /tmp/prometheus
antbed:
  postgresql:
    async_driver: asyncpg
    db: engine
    driver: psycopg2
    host: localhost
    params: {}
    password: oi
    port: 5432
    user: al
schedules: {}
sentry:
  dsn: null
  environment: null
  release: null
  traces_sample_rate: null
server:
  cors:
    allow_credentials: false
    allow_headers:
    - '*'
    allow_methods:
    - '*'
    allow_origin_regex: .*
    allow_origins:
    - http://localhost:8080
    - http://localhost:8000
    - http://localhost
  host: 0.0.0.0
  middlewares: []
  middlewares_replace_default: null
  port: 8080
  reload: false
  routers: []
  routers_replace_default: null
  server: ant31box.server.server:serve
  token: ''
